const rows = [
  { id: 1, number: 'Snow' },
  { id: 2, number: 'Lannister' },
  { id: 3, number: 'Lannister' },
  { id: 4, number: 'Stark' },
  { id: 5, number: 'Targaryen' },
  { id: 6, number: 'Melisandre' },
  { id: 7, number: 'Clifford' },
  { id: 8, number: 'Frances' },
  { id: 9, number: 'Roxie ' },
];

export default function DataTable() {
  return (
    <div>
      <DataGrid rows={rows} columns={columns} pageSize={5} checkboxSelection />
    </div>
  );
}
